import s from "../Styles/App.module.css";

const Articles = (props) => {
  return (
    <div>
      <div className={s.ArticlesFull}>
        <li>
          <a>{props.data[props.index]}</a>
        </li>
      </div>
    </div>
  );
};

export default Articles;
